-- ----------------------------
-- Table structure for artist
-- ----------------------------
DROP TABLE IF EXISTS `artist`;
CREATE TABLE `artist`  (
  `id` bigint(0) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '艺人/组合名',
  `profile` varchar(5000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '简介',
  `type` int(0) NOT NULL COMMENT '性质，0艺人1组合，艺人通常是一人，组合通常有两或多人',
  `real_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '艺人的真名，如果性质是艺人，需要填写此项',
  `nickname` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '昵称',
  `belong` json NULL COMMENT 'json数组，艺人/组合的所属组合，艺人/组合不能属于艺人',
  `official` json NULL COMMENT '官网，json数组',
  `picture` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '艺人的图片',
  `gmt_created` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '条目创建的时间',
  `gmt_modified` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '条目被修改（最新版本被应用）的时间',
  PRIMARY KEY (`id`) USING BTREE,
  FULLTEXT INDEX `conditional_search_fulltext_1`(`name`),
  FULLTEXT INDEX `conditional_search_fulltext_2`(`real_name`),
  FULLTEXT INDEX `conditional_search_fulltext_3`(`nickname`),
  FULLTEXT INDEX `conditional_search_fulltext_4`(`profile`),
  FULLTEXT INDEX `conditional_search_fulltext`(`name`, `real_name`, `nickname`, `profile`)
) ENGINE = InnoDB AUTO_INCREMENT = 7057977 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

