-- ----------------------------
-- Table structure for release
-- ----------------------------
DROP TABLE IF EXISTS `release`;
CREATE TABLE `release`  (
  `id` bigint(0) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `main_id` bigint(0) NULL DEFAULT NULL COMMENT '所属的主发行的id',
  `title` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '发行的标题，最多200字',
  `artist` json NOT NULL COMMENT 'json数组，数组项是对象，发行出自哪些艺人',
  `picture` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '专辑的封面',
  `release_label` json NOT NULL COMMENT 'json数组，数组项是对象，发行出自哪些厂牌，附带发行对应的厂牌内编号',
  `format` int(0) NULL DEFAULT NULL COMMENT '发行载体，1CD2黑胶3磁带4数字5其他',
  `form` int(0) NULL DEFAULT NULL COMMENT '发行形式，1全长专辑2迷你专辑3单曲4合作/合辑5其他',
  `country` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '发行国家',
  `release_date` date NOT NULL COMMENT '发行日',
  `genre` json NOT NULL COMMENT 'json数组，发行囊括哪些流派',
  `style` json NULL COMMENT 'json数组，发行囊括哪些风格',
  `tracklist` json NOT NULL COMMENT 'json数组，数据项目是对象，发行囊括哪些曲子',
  `credits` json NULL COMMENT '其他一些staff人员',
  `supplement` varchar(5000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'json数组，发行的各项补充说明文',
  `gmt_created` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '条目创建的时间',
  `gmt_modified` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '条目被修改（最新版本被应用）的时间',
  PRIMARY KEY (`id`) USING BTREE,
  FULLTEXT INDEX `conditional_search_fulltext`(`title`)
) ENGINE = InnoDB AUTO_INCREMENT = 25543092 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

