INSERT INTO `artist` VALUES (8090, 'The Ragga Twins', 'Consist of brothers (not actual twins) Flinty Badman ([a741774]) and Deman Rocker ([a741768]). Both were respected MC\'s starting off in a North London sound system & label called [l=Unity Sounds]. They formed the Ragga Twins in early 1990', 1, NULL, NULL, NULL, '[\"http://www.myspace.com/raggatwins\", \"http://en.wikipedia.org/wiki/Ragga_Twins\", \"https://www.facebook.com/OfficialRaggaTwins/?ref=br_rs\"]', NULL, '2023-01-28 17:38:34', '2023-04-22 17:13:53');
