INSERT INTO `artist` VALUES (1787629, 'Dodge & Fuski', 'Dubstep/Drumstep duo consisting of Rob \"Dodge\" Talbott and Christopher \"Fuski\" Allen. Based in Bristol, UK, currently (partially) living in California, USA. \r\n\r\nAllen briefly left the group in 2013, leaving Dodge & Fuski to become a solo act. In 2017 however, Allen returned to the group, ultimately making them a duo again.', 1, 'Rob Talbott and Christopher Allen', NULL, NULL, '[\"http://www.dodgeandfuski.com/\", \"http://www.facebook.com/dodgeandfuski\", \"http://twitter.com/dodgeandfuski\", \"http://soundcloud.com/dodgeandfuski\"]', NULL, '2023-01-28 17:54:43', '2023-01-28 17:54:43');
