INSERT INTO `artist` VALUES (2192106, 'Modestep', 'Dubstep/Electronic Rock singer, songwriter and producer from London, UK, now based in LA. \nModestep was formed in 2010 as a four-piece band consisting of brothers Josh & Tony Friend, alongside Josh\'s roommate Matthew Curtis and guitarist Nick Tsang.\nFrom around 2018 onward, Modestep became a duo, represented by Josh Friend and Patrick Lundy (ex-Funeral for a Friend drummer).\nIn November 2022, Lundy announced in a now-deleted Tweet that he would be departing from Modestep, ultimately leaving Josh as the sole member.', 1, 'Josh Friend', NULL, NULL, '[\"http://www.modestep.co.uk/\", \"http://www.myspace.com/modestep\", \"http://www.facebook.com/modestep\", \"http://en.wikipedia.org/wiki/Modestep\", \"http://soundcloud.com/Modestep\", \"\", \"http://equipboard.com/pros/modestep\"]', NULL, '2023-01-28 17:54:43', '2023-04-22 17:13:46');
