INSERT INTO `artist` VALUES (3034772, 'Getter', 'San Jose, California\'s Tanner Petulla produces ultra-aggressive dubstep, EDM, and trap under the name Getter. Born in 1993, he began creating tracks while in high school, uploading originals as well as homemade remixes of Far East Movement and Timbaland to his Soundcloud page. Almost immediately, his tracks saw release on small labels like Ultragore Recordings and Tuff Love Dubs, and dubstep DJs such as Datsik and Flux Pavilion began playing them. Several Getter EPs appeared on Datsik\'s Firepower Records and Excision\'s Rottun Recordings beginning in 2012. His debut full-length, I Want More, was released by Firepower in 2013. In 2014, Getter\'s official remixes of tracks by Borgore, Downlink, and Barely Alive were released. In 2015, Getter signed with Skrillex\'s OWSLA imprint, releasing the Allegiance EP (including the single \"Head Splitter\") and remixing several of the label\'s artists. OWSLA released another Getter EP, Radical Dude!, in 2016, and the artist\'s \"Suh Dude\" single appeared on Borgore\'s Buygore label. Getter produced rapper Pouya\'s album Underground Underdog, which was also released in 2016.', 1, 'Tanner Petulla', NULL, NULL, '[\"http://www.facebook.com/getterofficial\", \"http://soundcloud.com/getterofficial\", \"http://twitter.com/getterofficial\", \"http://www.youtube.com/c/getterofficial\", \"http://en.wikipedia.org/wiki/Getter_(musician)\", \"https://oldgetter.bandcamp.com/\"]', NULL, '2023-01-28 17:38:34', '2023-01-28 17:38:34');
INSERT INTO `artist` VALUES (3195952, 'Henry Fong (2)', 'American DJ and record producer (born September 12, 1986 in Jupiter, Florida, and moved to Los Angeles), who started DJing since 2011.', 0, 'Henry Jameson Fong', NULL, NULL, '[\"http://www.facebook.com/djhenryfong \", \"http://twitter.com/henryfong\", \"http://soundcloud.com/henryfong \", \"http://instagram.com/djhenryfong\", \"http://youtube.com/henryfong\"]', NULL, '2023-01-28 17:38:34', '2023-01-28 17:38:34');
