INSERT INTO `artist` VALUES (3640907, 'G-Buck', 'Philadelphia-based G-Buck definitely bucks the artificial boundaries imposed by genre. His skills as a producer and DJ/turntablist give him a flexibility with his art-form that makes him a complete package for top-tier success. G-Buck has tracks on Mad Decent/Jeffrees, Main Course, DimMak & Get Right Records (who released twerk anthem “Gijibae” – 250K plays at Soundcloud alone). Supported by the likes of Skrillex, Diplo, A-Trak, DJ Snake, UZ, Munchi, & TJR - G-Buck has merely been testing the waters with his variety of stellar productions', 0, NULL, NULL, NULL, '[\"https://www.facebook.com/djgbuck\", \"https://soundcloud.com/gbuck\"]', NULL, '2023-01-28 17:38:34', '2023-01-28 17:38:34');
