INSERT INTO `artist` VALUES (3760654, 'Ray Volpe (2)', '\"RAY VOLPE IS ONE OF THOSE PRODUCERS WHO ISN’T AFRAID IN TAKING THE TIME TO PERFECT HIS CRAFT AND CREATE HIS OWN SIGNATURE SOUND. THROUGH HIS YEARS OF DEDICATION AS ONE OF THE YOUNGEST PRODIGIES IN BASS MUSIC, RAY HAS GATHERED SUPPORT FROM SOME OF THE BIGGEST NAMES IN DANCE MUSIC INCLUDING DIPLO, EXCISION, PORTER ROBINSON, DILLON FRANCIS, FLOSSTRADAMUS, NGHTMRE, JAUZ AND MANY MORE.\r\n\r\nTHE LONG ISLAND TO CHARLOTTE WUNDERKIND ISN’T JUST A DYNAMIC PRODUCER, AS RAY IS ABLE TO FLEX HIS TALENTS AS A VOCALIST, WHICH CAN BE HEARD ON SOME OF HIS ORIGINAL TRACKS, INCLUDING THE TITLE RECORD FROM HIS CRITICALLY ACCLAIMED EP, BIPOLAR. ASIDE FROM HIS EXCEPTIONAL ORIGINAL WORKS, RAY HAS PUT OUT OFFICIAL REMIXES FOR GETTER ON OWSLA, GTA, BRILLZ AND OTHERS. WITH ALL THIS SUCCESS AT SUCH A YOUNG AGE, THE GOOD PEOPLE AT SLVYVLL HAVE ADDED HIM TO THEIR MANAGEMENT ROSTER THAT INCLUDES BORGORE & GETTER.\"', 0, NULL, NULL, NULL, '[\"https://soundcloud.com/rayvolpemusic\", \"https://twitter.com/rayvolpe\", \"https://www.instagram.com/rayvolpe/\", \"https://www.youtube.com/rayvolpe\", \"https://plus.google.com/u/0/+rayvolpe\", \"http://www.rayvolpemusic.com/\", \"https://www.songkick.com/artists/7455719-ray-volpe\", \"https://www.snapchat.com/add/rayvolpe\", \"https://open.spotify.com/artist/2K9qsrYnsu1EWt7ZQkkuXb\", \"https://www.facebook.com/rayvolpemusic\"]', NULL, '2023-01-28 17:54:43', '2023-01-28 17:54:43');
