INSERT INTO `artist_history` VALUES (5, 0, 2192106, 'Modestep', '[\"profile\"]', 1, '123', '{\"name\": \"Modestep\", \"type\": 1, \"belong\": null, \"picture\": null, \"profile\": \"Dubstep/Electronic Rock singer, songwriter and producer from London, UK, now based in LA. \\nModestep was formed in 2010 as a four-piece band consisting of brothers Josh & Tony Friend, alongside Josh\'s roommate Matthew Curtis and guitarist Nick Tsang\\nFrom around 2018 onward, Modestep became a duo, represented by Josh Friend and Patrick Lundy (ex-Funeral for a Friend drummer).\\nIn November 2022, Lundy announced in a now-deleted Tweet that he would be departing from Modestep, ultimately leaving Josh as the sole member.\", \"nickname\": null, \"official\": [\"http://www.modestep.co.uk/\", \"http://www.myspace.com/modestep\", \"http://www.facebook.com/modestep\", \"http://en.wikipedia.org/wiki/Modestep\", \"http://soundcloud.com/Modestep\", \"\", \"http://equipboard.com/pros/modestep\"], \"realName\": \"Josh Friend\"}', '11', 1, 2, '2023-04-11 17:03:11', '[2]', '2023-04-06 18:21:52', '2023-04-11 17:06:00');
INSERT INTO `artist_history` VALUES (6, 0, 2192106, 'Modestep', '[\"profile\"]', 1, '123', '{\"name\": \"Modestep\", \"type\": 1, \"belong\": null, \"picture\": null, \"profile\": \"Dubstep/Electronic Rock singer, songwriter and producer from London, UK, now based in LA. \\nModestep was formed in 2010 as a four-piece band consisting of brothers Josh & Tony Friend, alongside Josh\'s roommate Matthew Curtis and guitarist Nick Tsang.\\nFrom around 2018 onward, Modestep became a duo, represented by Josh Friend and Patrick Lundy (ex-Funeral for a Friend drummer).\\nIn November 2022, Lundy announced in a now-deleted Tweet that he would be departing from Modestep, ultimately leaving Josh as the sole member.\", \"nickname\": null, \"official\": [\"http://www.modestep.co.uk/\", \"http://www.myspace.com/modestep\", \"http://www.facebook.com/modestep\", \"http://en.wikipedia.org/wiki/Modestep\", \"http://soundcloud.com/Modestep\", \"\", \"http://equipboard.com/pros/modestep\"], \"realName\": \"Josh Friend\"}', '123', 1, 1, '2023-04-11 17:03:11', NULL, '2023-04-06 18:40:46', '2023-04-11 17:03:11');
INSERT INTO `artist_history` VALUES (7, 0, 2192106, 'Modestep', '[\"profile\"]', 1, '123', '{\"name\": \"Modestep\", \"type\": 1, \"belong\": null, \"picture\": null, \"profile\": \"Dubstep/Electronic Rock singer, songwriter and producer from London, UK, now based in LA. \\nModestep was formed in 2010 as a four-piece band consisting of brothers Josh & Tony Friend, alongside Josh\'s roommate Matthew Curtis and guitarist Nick Tsang\\nFrom around 2018 onward, Modestep became a duo, represented by Josh Friend and Patrick Lundy (ex-Funeral for a Friend drummer).\\nIn November 2022, Lundy announced in a now-deleted Tweet that he would be departing from Modestep, ultimately leaving Josh as the sole member.\", \"nickname\": null, \"official\": [\"http://www.modestep.co.uk/\", \"http://www.myspace.com/modestep\", \"http://www.facebook.com/modestep\", \"http://en.wikipedia.org/wiki/Modestep\", \"http://soundcloud.com/Modestep\", \"\", \"http://equipboard.com/pros/modestep\"], \"realName\": \"Josh Friend\"}', '12345', 1, 2, '2023-04-11 17:03:11', NULL, '2023-04-06 18:44:44', '2023-04-11 17:03:11');
