INSERT INTO `label` VALUES (173300, 'Never Say Die', NULL, NULL, NULL, 'Dubstep/Breaks/Drum & Bass label based out of London. [a=Skism (4)] founded the label in 2009 and is the owner of the label.\r\n\r\nLabel shut down in 2022', '[\"http://wewillneversaydie.com/\", \"http://facebook.com/wewillneversaydie\", \"http://twitter.com/neversaydie\", \"http://soundcloud.com/neversaydie\"]', '[\"info@wewillneversaydie.com\", \"http://www.wewillneversaydie.com/contact/\", \"\"]', '2023-01-28 18:15:55', '2023-01-28 18:15:55');
INSERT INTO `label` VALUES (641895, 'Disciple Recordings', NULL, NULL, NULL, '[b]Note: Any new releases must go under [l=Disciple (3)] (their current name, since they retired the Disciple Recordings name in mid-February 2016).[/b]\r\n\r\nElectronic music label founded in 2013 by [a=Rob Talbott] (from [a=Dodge & Fuski]) and [a=Ross Burr], aka Myro; also a member of [a=Astronaut (7)]). The label usually releases dubstep, electro house, trap, glitch hop and bass house.\r\n\r\nThe current roster of artists signed to the label (as of June 2017, in no particular order) include Dodge & Fuski, [a=Virtual Riot], [a=Dubloadz], [a=Barely Alive], [a=Myro (2)], Astronaut, [a=Fox Stevenson], [a=Oolacile], [a=PhaseOne (2)], [a=Truth (18)] and [a=The Others (7)].\r\n \r\n', '[\"http://www.disciplerecs.com/\", \"https://www.facebook.com/DiscipleRecordings\", \"https://twitter.com/Disciplerecs\", \"https://soundcloud.com/Disciple\", \"https://www.youtube.com/disciplerecordings\"]', '[\"Label Management: ed@disciplerecs.com\", \"Demos & A+R: demos@disciplerecs.com\", \"Press: hamish@illuminated-pr.com\"]', '2023-01-27 22:48:19', '2023-01-27 22:48:19');
