INSERT INTO `release` VALUES (5136839, NULL, 'Doom EP', '[{\"id\": 2309900, \"name\": \"Eptic\"}]', NULL, '[{\"id\": 173300, \"name\": \"Never Say Die\", \"catno\": \"NSDX048\"}]', 4, 5, NULL, '2013-11-18', '[\"Electronic\"]', '[\"Dubstep\", \"Drum n Bass\", \"House\"]', '[{\"title\": \"Gun Finga\", \"artist\": [{\"id\": 2309900, \"name\": \"Eptic\", \"role\": \"\"}], \"duration\": \"3:11\", \"position\": \"1\", \"extraartists\": null}, {\"title\": \"Z\", \"artist\": [{\"id\": 2309900, \"name\": \"Eptic\", \"role\": \"\"}, {\"id\": 3491633, \"name\": \"MUST DIE!\", \"role\": \"\"}], \"duration\": \"3:45\", \"position\": \"2\", \"extraartists\": null}, {\"title\": \"Watch Yo Back\", \"artist\": [{\"id\": 2309900, \"name\": \"Eptic\", \"role\": \"\"}], \"duration\": \"3:00\", \"position\": \"3\", \"extraartists\": null}, {\"title\": \"Genesis\", \"artist\": [{\"id\": 2309900, \"name\": \"Eptic\", \"role\": \"\"}], \"duration\": \"3:45\", \"position\": \"4\", \"extraartists\": null}, {\"title\": \"Danger (Habstrakt VIP)\", \"artist\": [{\"id\": 2309900, \"name\": \"Eptic\", \"role\": \"\"}], \"duration\": \"5:14\", \"position\": \"5\", \"extraartists\": null}]', '[]', 'Eptic returns with his latest EP, Doom via Never Say Die Records on November 18, 2013. Says Eptic, \"My life consists of writing music and illustrating. \'Doom\' is all about bringing these two worlds together and creating a whole. This EP was one big adventure, through experimenting, I broke out of numerous habits I got myself stuck into over the years, discovering new ways to express myself, and new fields I had never entered before. Although most of the songs have quite a few happy touches, they all have their dark side, resulting in all of them being part of the same sinister story that is the \'Doom EP\'.\"', '2023-01-28 18:24:36', '2023-01-28 18:24:36');
