INSERT INTO `release` VALUES (11460721, NULL, 'Krime Time', '[{\"id\": 4196103, \"name\": \"Krimer\"}]', NULL, '[{\"id\": 1032532, \"name\": \"Never Say Die Black Label\", \"catno\": \"NSDBL040\"}]', 4, 2, 'US', '2018-01-22', '[\"Electronic\"]', '[\"Dubstep\"]', '[{\"title\": \"Damage\", \"artist\": [{\"id\": 4196103, \"name\": \"Krimer\", \"role\": \"\"}], \"duration\": \"4:18\", \"position\": \"1\", \"extraartists\": [{\"id\": 5165163, \"name\": \"Mikey Ceaser\", \"role\": \"Featuring\"}]}, {\"title\": \"Countdown\", \"artist\": [{\"id\": 4196103, \"name\": \"Krimer\", \"role\": \"\"}], \"duration\": \"3:37\", \"position\": \"2\", \"extraartists\": null}, {\"title\": \"Got Dam!\", \"artist\": [{\"id\": 4196103, \"name\": \"Krimer\", \"role\": \"\"}, {\"id\": 3471672, \"name\": \"Spag Heddy\", \"role\": \"\"}], \"duration\": \"3:45\", \"position\": \"3\", \"extraartists\": null}, {\"title\": \"Switch\", \"artist\": [{\"id\": 4196103, \"name\": \"Krimer\", \"role\": \"\"}], \"duration\": \"3:08\", \"position\": \"4\", \"extraartists\": null}]', '[]', '\"I\'m super excited to finally be releasing my new project. This project means so much to me and it\'s basically the way I see things. I took quite a long time to write these songs because I wanted to deliver something totally unique and something that reflects the way I am. I had the pleasure of working with Spag Heddy and Mikey Ceaser, both super talented artists and I\'m blessed to now call them my friends. I feel that this EP came from all the emotions I\'ve been dealing with this past year. This is for anyone but especially those who need to let go and remove negativity from their mind. Never Say Die.\"', '2023-01-28 18:40:50', '2023-01-28 18:40:50');
